var lengthOfLongestSubstring = function (s) {
    var num = 0;
    var len = s.length;
    let arr = [];
    var i = j = 0;
    while (i < len && j < len) {
        if (!arr.includes(s[j])) {
            arr.push(s[j++]);
            num = Math.max(num, j-i);
        } else {
            arr.shift();
            i++;
        }
    }

    return num
};

